    false,nt"url": null,nt"notes": "MASSACHUSETTS AND RHODE ISLAND: The U.S.
    Army Corps of Engineers collects (by themselves and contractors) and maintains LiDAR
    data including orthophotos in coastal areas of the United States and its territories.
    The Corps acquires this data in the course of performing its mission of Flood Control,
    Navigation, Environmental Engineering, and support for the Army and others. Topographic
    LIDAR datasets were collected using a SHOALS-1000T at 500m altitude, spot density
    of 2m x 1 m and sampling rate 10kHz. Bathymetric data were collected using a SHOALS-1000T
    hydrographic laser flying at 400m altitude, spot spacing 5m x 5m and 1kHz sampling
    rate. MA and RI Data Date of Collection: Topo 20051111-20051202 Bathy: 20070527-20070601
    MAINE: The U.S. Army Corps of Engineers collects (by themselves and contractors)and
    maintains LiDAR data including orthophotos in coastal areas of the United States
    and its territories. Topographic LIDAR datasets were collected using a SHOALS-1000T
    at 500m altitude, spot density of 2m x 1m and sampling rate of 10 kHz. Topo data
    were also collected with a Leica ALS-50 sensor at 1600m altitude spot spacing of
    1m x 1m spot spacing, and 133 kHz sampling rate. Bathymetric data were collected
    using a SHOALS-1000T hydrographic laser flying at 400m altitude, spot spacing 5m
    x 5m and 1kHz sampling rate. ME Data Date of Collection: Topo 20051019-20070806
    Bathy: 20070606-20070611 This data is not a bare earth dataset.",nt"owner_org":
